Color.script:
'use strict';

/**
 * @param {Vec3} value - for property 'Color'
 * @return {Vec3} - update current property value
 */
let initvalue;
export function update() {

	return initvalue;
}

/**
 * @param {Object} changedUserProperties - only includes user properties that were recently changed!
 */
export function applyUserProperties(properties) {
	if (properties.particlecolor != undefined) {

		initvalue= properties.particlecolor;
	}
}

/**
 * @param {Vec3} value - for property 'Color'
 * @return {Vec3} - update current property value
 */
export function init(value) {
	initvalue= value;
}
